import EventBox from './eventBoxes';
import React from 'react';
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.css';

const handleDragStart = (e) => e.preventDefault();

const items = [
  <img src="path-to-img" onDragStart={handleDragStart} role="presentation" />,
  <img src="path-to-img" onDragStart={handleDragStart} role="presentation" />,
  <img src="path-to-img" onDragStart={handleDragStart} role="presentation" />,
];

const Gallery = () => {
  return (
    <AliceCarousel mouseTracking items={items} />
  );
}
export default function EventCarousel(props) {
    return (
        <div className='flex flex-nowrap justify-center  w-full h-[300px] '>
        <div className='flex space-x-10 bg-[#0A0A0A]  place-items-center w-full h-full flex-nowrap mt-0'>
          <EventBox
            eventName="Hack the box" 
            eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
            dpt="coding"
            time="2nd Nov 9:50"
          />
          <EventBox 
            eventName="Relay Typing" 
            eventDescription="Pretend like you know how to code but you're just typing someone else's algorithm" 
            dpt="robotics"
            time="3rd Nov 1:00"
          />
          <EventBox 
            eventName="Hack the box" 
            eventDescription="Sit in front of a box and pretend you know how to hack like you're mr.robot" 
            dpt="departmental"
            time="2nd Nov 9:50"
            />
        </div>
      </div>
    )
  }
